import * as ReactDOM from 'react-dom';
import * as React from 'react';
import { render } from 'react-dom';
import { updateSampleSection } from '../common/sample-base';
import { DocumentEditorContainerComponent, Toolbar } from '@syncfusion/ej2-react-documenteditor';
import { TitleBar } from './title-bar';
import { ButtonComponent } from '@syncfusion/ej2-react-buttons';
import './default.component.css';
import { MultiSelectComponent, CheckBoxSelection, Inject } from '@syncfusion/ej2-react-dropdowns';
import { CheckBoxComponent } from '@syncfusion/ej2-react-buttons';
DocumentEditorContainerComponent.Inject(Toolbar);
// tslint:disable:max-line-length
function ToolbarCustomization() {
    React.useEffect(() => {
        updateSampleSection();
        rendereComplete();
    }, [])
    let items = ['New', 'Open', 'Undo',
        'Redo',
        'Comments',
        'Image',
        'Table',
        'Hyperlink',
        'Bookmark',
        'TableOfContents',
        'Header',
        'Footer',
        'PageSetup',
        'PageNumber',
        'Break',
        'Find',
        'LocalClipboard',
        'RestrictEditing'];
    const hostUrl: string = 'https://services.syncfusion.com/react/production/api/documenteditor/';
    let container: DocumentEditorContainerComponent;
    let multiSelect: MultiSelectComponent;
    let titleBar: TitleBar;
    function rendereComplete(): void {
        window.onbeforeunload = function () {
            return 'Want to save your changes?';
        }
        container.documentEditor.pageOutline = '#E0E0E0';
        container.documentEditor.acceptTab = true;
        container.documentEditor.resize();
        titleBar = new TitleBar(document.getElementById('documenteditor_titlebar'), container.documentEditor, true);
        onLoadDefault();
    }
    function customize() {
        let toolbaritems: any = multiSelect.value;
        container.toolbarItems = toolbaritems;
    }
    return (<div className='control-pane'>
        <div className="col-lg-9 control-section">
            <div id='documenteditor_titlebar' className="e-de-ctn-title"></div>
            <div id="documenteditor_container_body">
                <DocumentEditorContainerComponent id="container" ref={(scope) => { container = scope; }} style={{ 'display': 'block' }}
                    height={'590px'} serviceUrl={hostUrl} enableToolbar={true} locale='en-US' />
            </div>
        </div>
        <div className="col-lg-3 property-section">
            <div className="property-panel-header">Select toolbar items</div>
            <div>
                <div id="multigroup" className="control-styles">
                    <MultiSelectComponent id="checkbox" ref={(scope) => { multiSelect = scope; }} dataSource={items} placeholder="Select toolbar items" mode="CheckBox" showSelectAll={true} showDropDownIcon={true} filterBarPlaceholder="Search toolbar items" popupHeight="350px">
                        <Inject services={[CheckBoxSelection]} />
                    </MultiSelectComponent>
                </div><br></br>
            </div>
            <div className="evtbtn">
                <ButtonComponent id="customize" onClick={customize.bind(this)}>Customize</ButtonComponent>
            </div>
        </div>
        <div id="action-description">
            <p>This example explains how to show or hide existing items in the toolbar.</p>
        </div>
        <div id="description">
            <p>Existing toolbar items can be hidden, shown, enabled, and disabled. Also, new items can be added to the toolbar.</p>
            <p style={{ 'display': 'block' }}> More information about the document editor features can be found in this <a target="_blank" href="https://ej2.syncfusion.com/react/documentation/document-editor/how-to/customize-tool-bar/">documentation section.</a>
            </p>
        </div>
    </div>);
    function onLoadDefault(): void {
        // tslint:disable
        let defaultDocument: object ={"sfdt":""};
        // tslint:enable        
        container.documentEditor.open(JSON.stringify(defaultDocument));
        container.documentEditor.documentName = 'Toolbar Customization';
        titleBar.updateDocumentTitle();
        container.documentChange = (): void => {
            titleBar.updateDocumentTitle();
            container.documentEditor.focusIn();
        };
    }
}
export default ToolbarCustomization;